import React from 'react'
import { TextField, Container } from '@mui/material';

export default function LoginForm() {
    return (
        <Container maxWidth="sm">
            <TextField id="outlined-basic" placeHolder='First Name' label="Outlined" variant="outlined" />
            <TextField id="outlined-basic" placeHolder='Last Name' label="Outlined" variant="outlined" />
            <TextField id="outlined-basic" placeHolder='Email Id' label="Outlined" variant="outlined" />
            <TextField id="outlined-basic" placeHolder='Password' label="Outlined" variant="outlined" />
            <TextField id="outlined-basic" placeHolder='Confirm Password' label="Outlined" variant="outlined" />
            
        </Container>
    )
}
